import React from 'react';

const MemeCard = (meme) => {
    return (
    <div className="meme-card" style = {{backgroundColor: "#f0f0f0"}}>
        <img className="meme-picture" src={meme.url} />
        <h4>{meme.name}</h4>
        {meme.texts && meme.texts.map((text, index) => (
                <p key={index}>{text}</p>
            ))}
    </div>
    );
};

export default MemeCard;
